(1, 1, 1, 'E-commerce 쇼핑몰 구축 (Vue & Laravel)', 'Vue.js와 Laravel을 활용하여 대형 쇼핑몰을 개발하고, 실시간 주문 관리 시스템을 구현했습니다.', 'https://www.onestack.store/images/default-thumbnail.png', 'https://www.onestack.store/images/default-project1.png', 'https://www.onestack.store/images/default-project2.png', 'https://www.onestack.store/images/default-project3.png', 'https://www.onestack.store/images/default-project4.png', 'https://www.onestack.store/images/default-project5.png', 'https://www.onestack.store/images/default-project6.png', 'https://www.onestack.store/images/default-project7.png', 'https://www.onestack.store/images/default-project8.png', 'https://www.onestack.store/images/default-project9.png', 'https://www.onestack.store/images/default-project10.png'),
(2, 2, 2, '핀테크 서비스 UX/UI 기획', '사용자 친화적인 핀테크 애플리케이션 UX/UI를 기획하고, 와이어프레임을 제작하여 개발팀과 협업을 진행했습니다.', 'https://www.onestack.store/images/default-thumbnail.png', 'https://www.onestack.store/images/default-project.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3, 3, 3, 'AI 기반 데이터 분석 대시보드', 'Python과 Django를 이용하여 데이터 시각화 대시보드를 제작하고, AI 모델 분석 결과를 실시간으로 제공하는 기능을 개발했습니다.', 'https://www.onestack.store/images/default-thumbnail.png', 'https://www.onestack.store/images/default-project.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4, 4, 4, 'AI 기반 추천 시스템 기획', '고객 맞춤형 추천 시스템 기획을 진행하여, 머신러닝 모델이 적용 가능한 데이터 구조를 설계하고 UI/UX를 최적화했습니다.', 'https://www.onestack.store/images/default-thumbnail.png', 'https://www.onestack.store/images/default-project.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5, 5, 5, 'E-commerce 쇼핑몰 구축 (Vue & Laravel)', 'Vue.js와 Laravel을 활용하여 대형 쇼핑몰을 개발하고, 실시간 주문 관리 시스템을 구현했습니다.', 'https://www.onestack.store/images/default-thumbnail.png', 'https://www.onestack.store/images/default-project.png', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
