INSERT IGNORE INTO Review (review_no, pro_no, member_no, review_content, review_rate, review_date, review_activation)
VALUES
(1, 1, 34, '기획 외주가 기대 이상으로 완성도가 높았어요! 디자인도 직관적이고 사용하기 쉬워요.', 4, '2025-02-03 12:34:56', 1),
(2, 2, 5, '쇼핑몰 제작 외주, 정말 탁월했어요. 사용자 경험을 고려한 UI가 매우 만족스럽습니다.', 5, '2024-12-13 10:00:17', 1),
(3, 3, 62, '기획이 예상보다 덜 정교했어요. 수정이 좀 필요할 것 같습니다.', 1, '2025-01-02 14:30:03', 1),
(4, 4, 7, '다시 한번 훌륭한 결과물을 받아서 매우 기쁩니다. 의뢰할 때마다 만족스러워요.', 5, '2024-02-01 09:00:22', 1),
(5, 5, 86, '완성도는 좋지만, 몇 가지 레이아웃에서 불편한 점이 있었어요. 수정이 필요합니다.', 2, '2025-02-03 12:34:21', 1),
(6, 1, 92, '디자인 퀄리티가 정말 뛰어나요! 사용자의 편의를 생각한 부분이 마음에 들었습니다.', 4, '2025-01-18 16:45:32', 1),
(7, 1, 37, '전체적인 디자인과 UI가 훌륭했어요. 작업이 아주 만족스럽습니다. 다시 의뢰하고 싶습니다.', 4, '2025-01-18 16:45:40', 1),
(8, 1, 13, '깔끔하고 직관적인 UI 덕분에 프로젝트가 한층 더 돋보였어요. 아주 만족스럽습니다.', 4, '2025-01-18 16:45:23', 1),
(9, 1, 33, '디자인 흐름이 매끄럽고, 결과물이 정말 만족스러워요. 전문가다운 작업입니다.', 4, '2025-01-18 16:45:52', 1),
(10, 1, 53, '기획이 세심하게 잘 되어 있어서 기대 이상으로 만족스럽습니다. 매우 훌륭한 작업이었어요.', 4, '2025-01-18 16:45:13', 1),
(11, 1, 90, '다시 의뢰하고 싶은 디자인입니다. 예상보다 훨씬 더 퀄리티 높은 작업이었어요.', 4, '2025-01-18 16:45:49', 1),
(12, 1, 103, '작업 결과는 꽤 괜찮았어요. 몇 가지 작은 수정은 필요하지만 전반적으로 만족합니다.', 4, '2025-01-18 16:45:27', 1),
(13, 1, 387, '내가 원했던 방향 그대로 작업이 이루어졌어요. 다음에도 믿고 맡길 수 있을 것 같습니다.', 4, '2025-01-18 16:45:23', 1),
(14, 1, 423, '결과물에 매우 만족합니다. 디자인 퀄리티가 뛰어나고, 사용자 편의성을 고려한 부분이 좋아요.', 4, '2025-01-18 16:45:43', 1),
(15, 1, 223, '전체적으로 아주 좋은 결과물을 받았습니다. 퀄리티가 높고 디자인이 세련되었어요.', 4, '2025-01-18 16:45:00', 1),
(16, 2, 345, '쇼핑몰 외주, 정말 유용한 디자인이었어요. 직관적이고 사용자가 쉽게 접근할 수 있어요. 추천드립니다!', 4, '2025-01-18 16:45:00', 1);
INSERT IGNORE INTO Inquiry (inquiry_no, member_no, inquiry_title, inquiry_content, inquiry_reg_date, inquiry_file, inquiry_status, inquiry_satisfaction)
VALUES
(1, 1, '비밀번호 변경 방법', '안녕하세요, 비밀번호를 변경하고 싶은데 어디에서 변경할 수 있나요? 마이페이지에서 변경 가능한가요?', '2025-02-01 10:05:12', NULL, '답변 중', NULL),
(2, 2, '로그인 문제', '계정에 로그인할 수 없습니다. 비밀번호를 정확히 입력했는데도 로그인이 되지 않습니다. 어떻게 해야 하나요?', '2025-02-01 10:10:45', NULL, '답변 중', NULL),
(3, 3, '결제 오류', '결제 중 오류가 발생하여 주문을 완료할 수 없습니다. 오류 메시지가 "결제 실패"라고 뜹니다.', '2025-02-01 10:15:33', NULL, '답변 대기', NULL),
(4, 4, '배송 조회', '주문한 상품의 배송 상태를 확인하고 싶습니다. 배송 조회 화면에서 상태 업데이트가 없습니다.', '2025-02-01 10:20:21', NULL, '답변 중', NULL),
(5, 5, '환불 요청', '구매한 상품이 마음에 들지 않아 환불을 요청합니다. 어떻게 환불 절차를 진행할 수 있을까요?', '2025-02-01 10:25:09', NULL, '답변 완료', 1),
(6, 6, '계정 해킹 의심', '제 계정이 해킹된 것 같습니다. 확인 부탁드립니다. 이상한 로그인 기록이 있습니다.', '2025-02-01 10:30:47', NULL, '답변 완료', 0),
(7, 7, '프로모션 코드 사용 방법', '받은 프로모션 코드를 어떻게 사용할 수 있나요? 사용 방법을 알려주세요.', '2025-02-01 10:35:29', NULL, '답변 대기', NULL),
(8, 8, '회원 정보 수정', '전화번호를 변경하고 싶은데 어떻게 해야 하나요? 마이페이지에서 가능한가요?', '2025-02-01 10:40:11', NULL, '답변 중', NULL),
(9, 9, '앱 오류', '앱 사용 중 자꾸 오류가 발생합니다. 해결 방법이 있을까요? 오류 메시지가 자주 뜹니다.', '2025-02-01 10:45:57', NULL, '답변 대기', NULL),
(10, 10, '상품 문의', '해당 상품의 재고가 언제 다시 입고되나요? 입고 일정이 궁금합니다.', '2025-02-01 10:50:36', NULL, '답변 중', NULL);
INSERT IGNORE INTO InquiryAnswer (inquiry_no, member_no, inquiry_answer_content, inquiry_answer_file, inquiry_answer_reg_date)
VALUES
(1, 31, '안녕하세요, 비밀번호 변경 방법에 대해 안내드리겠습니다. 마이페이지 > 계정 설정에서 변경 가능합니다.', NULL, '2025-02-01 11:00:30'),
(1, 1, '마이페이지에 들어갔는데도 찾을 수 없습니다. 좀 더 자세히 알려주실 수 있나요?', NULL, '2025-02-01 11:10:45'),
(1, 31, '마이페이지에 들어가신 후, 우측 상단의 "계정 설정"을 클릭하시면 됩니다.', NULL, '2025-02-01 11:20:15'),
(1, 1, '감사합니다! 변경 완료했습니다.', NULL, '2025-02-01 11:30:27'),
