    (17, 7, '외주 업무가 밀리면 어떻게 할까?', '일정 지키기 힘들다면 이렇게 대처하면 좋아.', sysdate()),
    (18, 8, '외주에 필요한 소프트웨어', '이 소프트웨어가 있으면 외주 진행이 훨씬 수월해.', sysdate()),
