(3, 3, 12, '기존 웹사이트 리뉴얼 견적 요청드립니다. SEO 최적화와 디자인 수정이 필요합니다.', 180000, 'SEO 최적화와 성능 개선을 포함합니다. 기존 코드의 문제를 해결해야 합니다.', 0, NOW(), NULL, 0),
(3, 4, 11, '모바일 앱 개발 견적을 요청드립니다. 사용자 인터페이스(UI) 개선이 중요합니다.', 350000, '추가적인 서버 비용이 발생할 수 있습니다. UI/UX 전문가와 협업 필요', 0, NOW(), NULL, 0),
(5, 5, 13, '설문조사 시스템 개발 견적을 요청합니다. 참여자 관리 및 데이터 분석 기능이 필요합니다.', 200000, '추가적으로 데이터 분석 툴 통합 필요, 설문 결과 리포트 제공', 0, NOW(), NULL, 0),
(5, 6, 12, '온라인 쇼핑몰 구축 견적을 부탁드립니다. 결제 시스템과 상품 관리 시스템이 필요합니다.', 500000, '결제 시스템과 배송 시스템 통합, 관리자 페이지 기능 포함', 0, NOW(), NULL, 0),
(6, 7, 11, '기업 홈페이지 제작 견적을 요청드립니다. 기본적인 회사 소개 페이지와 채용 공고 게시판이 필요합니다.', 150000, '기본 템플릿 기반으로 제작되며, 기능 추가 시 별도 비용 발생', 0, NOW(), NULL, 0),
(2, 8, 13, '보건 시스템 개발 견적을 요청드립니다. 환자 데이터 관리와 예약 시스템이 포함됩니다.', 400000, '환자 데이터 관리와 예약 시스템 구축, API 통합 필요', 0, NOW(), NULL, 0);
